def compress(data):
    result = []
    zero_count = 0
    for byte in data:
        if byte == 0:
            zero_count += 1
            if zero_count == 255:  # 避免溢出
                result.extend([0, 255])
                zero_count = 0
        else:
            if zero_count > 0:
                result.extend([0, zero_count])
                zero_count = 0
            result.append(byte)
    
    # 处理结尾的零
    if zero_count > 0:
        result.extend([0, zero_count])
    
    return result


def to_file():
    import btree # type: ignore

    try:
        f = open(f'./font_{setting['width'][0]}x{setting['height'][0]}{'_rle' if setting['rle'][0]==1 else ''}.db', "r+b")
    except OSError:
        f = open(f'./font_{setting['width'][0]}x{setting['height'][0]}{'_rle' if setting['rle'][0]==1 else ''}.db', "w+b")
    db=btree.open(f)
    db[b'WIDTH']=setting['width']
    db[b'HEIGHT']=setting['height']
    db[b'DEFAULT']=bytes()
    db[b'RLE']= bytes([1]) if setting['rle'][0]==1 else bytes([0])

    for num,char in enumerate(string):
        cache = []
        for line in range(int( len(hex_list)/len(string)/2 ) ):
            cache += [hex_list[line*190+num*2],hex_list[line*190+num*2+1]]
        if setting['rle'][0]==1:
            cache=compress(cache)
        db[bytes([char])]=bytearray(cache)

    db.flush()

    db.close()
    # Don't forget to close the underlying stream!
    f.close()

